mutation DeletePublicMetadata($id: ID!, $keys: [String!]!) {
    deleteMetadata(
        id: $id
        keys: $keys
    ) {
        metadataErrors{
            field
            code
        }
        item {
            metadata{
                key
                value
            }
            ...on User{
                id
            }
        }
    }
}
